import axios from "axios";

const testGet = () => {
    axios.get("/oauth2/csrf").then((resp) => {
        console.log(resp);
    })
}

const testPost = () => {
    axios.post("/test").then((resp) => {
        console.log(resp);
    })
}

const logout = () => {
    axios.post("/oauth2/logout").then((resp) => {
        console.log(resp);
    })
}

export default function SignUp() {
    const httpRequest = new XMLHttpRequest();

    const headers = httpRequest.getAllResponseHeaders();

    return (
        <main style={{ padding: "1rem 0" }}>
            <h2>SignUp</h2>
            <div>
                header : 
                {headers}
            </div>
            <button onClick={logout}>Logout</button>
            <button onClick={testGet}>testGet</button>
            <button onClick={testPost}>testPost</button>
        </main>
    );
}
